import "../style.css"

const MainPage = () => {
  return(
    <>
    <header>
      <div className="navbar">
        <h1 className="navbar-title">Main Page</h1>
      </div>
    </header> 
    <main>
      <section className="router-section">

      </section>
    </main>
    </>
  )
};

export default MainPage;
